import React from "react";
// import "./Nav.css";

const Nav = props => (
    <nav
        class="navbar"><ul><li class="brand"><a href="/">Clicky Game</a></li>


        <li class="">You guessed correctly!{props.correctIncorrect}</li>

        <li>Score - Top: {props.topScore} | Current: {props.score}</li></ul>


        <header class="header"><h1>Clicky Game!{props.title}</h1></header>


        <h2>Click on an image to earn points, but don't click on any more than once!</h2>

        </nav>  


);

export default Nav;
